export const Card: FC<ICard> = ({ photo, name, job, description, button }) => {
    return (
      <div className={style.card} style={{ backgroundImage: `url(${photo})` }}>
        <div className={style.person} />
        <p className={style.name}>{name}</p>
        <p className={style.job}>{job}</p>
        <p className={style.text}>{description}</p>
        <ButtonLink
          imgDefault={button.icons.default}
          imgHover={button.icons.hovered}
          imgClick={button.icons.clicked}
          href={button.href}
          className={style.link}
        />
